import { useEffect, useState } from "react";
import { useParams } from "react-router-dom";

const UserPageLoad = () => {
  const { id } = useParams();

  const [getPost, setPost] = useState(null);

  useEffect(() => {
    fetch("https://jsonplaceholder.typicode.com/users/" + id)
      .then((res) => res.json())
      .then((data) => {
        console.log(data);
        setPost(data);
      });
  }, []);

  return (
    <div>
      {getPost && (
        <div>
          <div>Album Title:{getPost.title}</div>
          <div>User ID: {getPost.userId}</div>
          <button>GET USER</button>
        </div>
      )}
    </div>
  );
};

export default UserPageLoad;
